import React, { useState, useContext } from "react";
import { Redirect, Route } from "react-router-dom";
import LoginMod from "../components/modals/LoginMod";
import { UserContext } from "../context/Contextusr";

const PrivateAdmin = ({ component: Component, ...rest }) => {
  const login = localStorage.getItem("tokenkey");
  const [modlog, setModlog] = useState(true);

  return (
    <>
      <Route
        {...rest}
        render={(props) =>
          login ? <Component {...props} /> : <Redirect to="/" />
        }
      />
    </>
  );
};

export default PrivateAdmin;
